import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Start from './pages/Start';



function App() {
  return (

    <div style={{height: "100vh"}}>
      <Router>
        <Routes>
        <Route path="/" element={<Start />}/>
        {/* <Route path="/login" element={<Login />}/> */}
        </Routes>
      </Router> 
    </div>
  );
}

export default App;
